import React, {Component} from 'react';
import {Result} from './Result';

export class ResultGroup extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        };
    }
    render() {
        let r = [];
        for (let i = 0; i < 6; i++) {
            r.push(<Result/>);
        }
        return (
            <div>
                {r}
            </div>
        )
    }
}
